&lt;b&gt;Estética deslumbrante e design aperfeiçoado&lt;/b&gt;&lt;br/&gt;&amp;bull; Design frontal e traseiro simétricos&lt;br/&gt;&amp;bull; Vidro 3D curvo para pegada confortável&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Câmera quádrupla de 48MP + 8MP + 5MP + 2MP&lt;/b&gt;&lt;br/&gt;&amp;bull; Ultra-nítida, ultra grande-angular, ultra-macro, e profundidade&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Tela FHD+ Dot Display de 6,67&quot;&lt;/b&gt;&lt;br/&gt;&amp;bull; Certificação de baixa emissão de luz azul da TÜV Rheinland&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Qualcomm Snapdragon 720G&lt;/b&gt;&lt;br/&gt;&amp;bull; Experiência extraordinária para jogos&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Bateria de alta capacidade de 5020 mAh com suporte a carregamento rápido de 18W&lt;/b&gt;&lt;br/&gt;&amp;bull; Suporta até 13 horas de jogos&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Qualidade superior&lt;/b&gt;&lt;br/&gt;&amp;bull; Corning® Gorilla® Glass 5 frontal e traseiro&lt;br/&gt;&amp;bull; Motor de vibração linear de eixo Z&lt;br/&gt;&lt;br /&gt;&lt;b&gt;&lt;span style=&apos;font-size:18px;&apos;&gt;
CARACTERÍSTICAS
&lt;/span&gt;&lt;/b&gt;&lt;br /&gt;&lt;br /&gt;&lt;span style=&apos;font-size:18px;&apos;&gt;&lt;b&gt;Marca: &lt;/b&gt; Xiaomi&lt;br /&gt;&lt;b&gt;Modelo: &lt;/b&gt; Redmi Note 9S&lt;br /&gt;&lt;b&gt;Sistema operacional: &lt;/b&gt; Android 10 &lt;br /&gt;&lt;b&gt;Cor: &lt;/b&gt; Cinza&lt;br /&gt;&lt;b&gt;Armazenamento total: &lt;/b&gt; 128 GB&lt;br /&gt;&lt;b&gt;Armazenamento removível: &lt;/b&gt; microSD até 512 GB&lt;br /&gt;&lt;b&gt;Memória RAM: &lt;/b&gt; 6 GB&lt;br /&gt;&lt;b&gt;Tamanho do tela: &lt;/b&gt; 6,67&quot;&lt;br /&gt;&lt;b&gt;Resolução da tela: &lt;/b&gt; 2400 x 1080 FHD+&lt;br /&gt;&lt;b&gt;Resolução da câmera frontal: &lt;/b&gt; 16 MP&lt;br /&gt;&lt;b&gt;Resolução da câmera traseira: &lt;/b&gt; Quad (48 MP + 8 MP + 5 MP + 2 MP)&lt;br /&gt;&lt;b&gt;Resolução do vídeo: &lt;/b&gt; 4K 30fps&lt;br /&gt;&lt;b&gt;Rede: &lt;/b&gt; 4G, 3G e 2G&lt;br /&gt;&lt;b&gt;Quantidade de chip: &lt;/b&gt; 2&lt;br /&gt;&lt;b&gt;Cartão SIM: &lt;/b&gt; nano-SIM&lt;br /&gt;&lt;b&gt;WI-FI: &lt;/b&gt; 802.11 a/b/g/n/ac&lt;br /&gt;&lt;b&gt;Wi-Fi Direct: &lt;/b&gt; Sim&lt;br /&gt;&lt;b&gt;Versão de bluetooth: &lt;/b&gt; Bluetooth v5.0&lt;br /&gt;&lt;b&gt;USB: &lt;/b&gt; USB (Tipo C)&lt;br /&gt;&lt;b&gt;Processador: &lt;/b&gt; Octa Core &lt;br /&gt;&lt;b&gt;Velocidade de processador: &lt;/b&gt; 2.3 GHz&lt;br /&gt;&lt;b&gt;Modelo do processador: &lt;/b&gt; Qualcomm Snapdragon 720G&lt;br /&gt;&lt;b&gt;Sensores: &lt;/b&gt; Sensor de Impressão Digital, AI Face Unlock, Acelerômetro, Giroscópio, Proximidade, Bússola&lt;br /&gt;&lt;b&gt;Capacidade de bateria: &lt;/b&gt; 5020 mAh&lt;br /&gt;&lt;b&gt;Bateria Removível: &lt;/b&gt; Não&lt;br /&gt;&lt;b&gt;Peso: &lt;/b&gt; 209gr&lt;br /&gt;&lt;b&gt;Dimensões (LxAxP): &lt;/b&gt; 7,66 x 16,57 x 0,88cm&lt;br /&gt;&lt;/span&gt;

&lt;b&gt;Tela incrível, rolagem realmente suave&lt;/b&gt;&lt;br/&gt;Encante-se com detalhes vibrantes no display full HD+ Super AMOLED, alcançando 800 nits¹ para proporcionar mais nitidez mesmo com a luz do dia. O Eye Comfort Shield² reduz a luz azul e o recurso de rolagem suave mantém a visualização suave enquanto você joga ou navega.&lt;br/&gt;Tudo isso no amplo Infinity-U Display de 6.4 polegadas.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Design minimalista com estilo marcante&lt;/B&gt;&lt;br/&gt;Sinta o design elegante com borda suave do deslumbrante Galaxy A32. Com o design icônico da câmera e o acabamento brilhante na parte de trás, este celular não apenas se destaca, ele define um novo padrão. Escolha entre quatro belas cores: preto, branco, azul e violeta.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Câmera incrível para registrar todos os detalhes&lt;/b&gt;&lt;br/&gt;O sistema de câmera multilentes do Galaxy A32 aprimora as fotos. Use a alta resolução na câmera principal de 64 MP para tirar fotos nítidas e claras durante todo o dia. Expanda o ângulo de visão com a câmera Ultra wide. Personalize o foco com a câmera de profundidade ou fique mais perto dos detalhes com a câmera macro.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Câmera Ultra Wide para grandes momentos&lt;/b&gt;&lt;br/&gt;Semelhante à visão humana, a câmera Ultra Wide de 8 MP vê o mundo com um ângulo de visão de 123 graus, adicionando mais perspectiva a tudo o que você fotografa.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;A câmera macro foca nos pequenos detalhes&lt;/b&gt;&lt;br/&gt;Chegue mais perto com a câmera macro de 5 MP e realce os pequenos detalhes em sua imagem. Ele aplica o efeito bokeh natural às suas fotos, permitindo que o objeto se destaque do fundo.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Coloque o foco na frente com a câmera de profundidade&lt;/b&gt;&lt;br/&gt;A câmera de profundidade de 5MP permite ajustar a profundidade de campo das suas fotos. Com um simples toque, você pode ajustar facilmente o desfoque de fundo atrás do objeto para tirar retratos de alta qualidade que realmente se destacam.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Câmera frontal para tirar belas selfies&lt;/b&gt;&lt;br/&gt;Tire selfies incríveis com a câmera frontal de 20 MP do Galaxy A32. Encante-se com os detalhes claros ou desfoque o fundo com efeito bokeh para transformar suas selfies em autorretratos.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Bateria incrível que dura dois dias¹&lt;/b&gt;&lt;br/&gt;A bateria de 5.000 mAh (padrão)² oferece mais tempo para você fazer o que ama: streaming, compartilhar, jogar e muito mais. A gestão de bateria por IA detecta e se ajusta aos seus hábitos de uso do celular para proporcionar bateria duradoura. *Com até 15 W de Fast Charging, o Galaxy A32 volta a funcionar com bateria completa rapidamente.&lt;br/&gt;&lt;br /&gt;&lt;b&gt;&lt;span style=&apos;font-size:18px;&apos;&gt;
CARACTERÍSTICAS
&lt;/span&gt;&lt;/b&gt;&lt;br /&gt;&lt;br /&gt;&lt;span style=&apos;font-size:18px;&apos;&gt;&lt;b&gt;Marca: &lt;/b&gt; Samsung&lt;br /&gt;&lt;b&gt;Modelo: &lt;/b&gt; A32 &lt;br /&gt;&lt;b&gt;Cor: &lt;/b&gt; Branco&lt;br /&gt;&lt;b&gt;Sistema Operacional: &lt;/b&gt; Android&lt;br /&gt;&lt;b&gt;Memória RAM (GB): &lt;/b&gt; 4 GB&lt;br /&gt;&lt;b&gt;Memória Total Interna: &lt;/b&gt; 128 GB*&lt;br /&gt;&lt;b&gt;Memória Disponível: &lt;/b&gt; 101.0 GB*&lt;br /&gt;&lt;b&gt;Suporte ao Cartão de Memória: &lt;/b&gt; MicroSD (Up to 1TB)&lt;br /&gt;&lt;b&gt;Tipo do Processador: &lt;/b&gt; Octa Core &lt;br /&gt;&lt;b&gt;Velocidade do Processador: &lt;/b&gt; 2GHz, 1.8GHz&lt;br /&gt;&lt;b&gt;Informações Gerais Formato: &lt;/b&gt; Barra Touch&lt;br /&gt;&lt;b&gt;Tela: &lt;/b&gt; 6.4  polegadas&lt;br /&gt;&lt;b&gt;Resolução (Tela Principal): &lt;/b&gt; 1080 x 2400 (FHD+)&lt;br /&gt;&lt;b&gt;Tecnologia (Tela Principal): &lt;/b&gt; Super AMOLED&lt;br /&gt;&lt;b&gt;Profundidade de Cor (Tela Principal): &lt;/b&gt; 16MP&lt;br /&gt;&lt;b&gt;Bateria: &lt;/b&gt; 5.000 mAh&lt;br /&gt;&lt;b&gt;Câmeras Traseiras (Múltiplas) - Resolução: &lt;/b&gt; 64 MP + 8 MP + 5 MP + 5 MP&lt;br /&gt;&lt;b&gt;Câmeras Traseiras - Foco Automático: &lt;/b&gt; Sim&lt;br /&gt;&lt;b&gt;Câmeras Traseiras - Zoom: &lt;/b&gt; Zoom Digital até 10x&lt;br /&gt;&lt;b&gt;Câmera Frontal - Abertura: &lt;/b&gt; F2.2&lt;br /&gt;&lt;b&gt;Câmeras Traseiras (Múltiplas) - Abertura: &lt;/b&gt; F1.8 , F2.2 , F2.4 , F2.4&lt;br /&gt;&lt;b&gt;Câmera Frontal - Resolução: &lt;/b&gt; 20.0 MP&lt;br /&gt;&lt;b&gt;Câmera Traseira - Flash: &lt;/b&gt; Sim&lt;br /&gt;&lt;b&gt;Resolução de Gravação de Vídeos: &lt;/b&gt; FHD (1920 x 1080) @30fps &lt;br /&gt;&lt;b&gt;Quantidade de chip: &lt;/b&gt; Dual chip&lt;br /&gt;&lt;b&gt;Tipo de Chip (SIM Card): &lt;/b&gt; Nano-SIM (4FF)&lt;br /&gt;&lt;b&gt;Tipo de Slot de Chip: &lt;/b&gt; Chip 1 + Chip 2 + MicroSD&lt;br /&gt;&lt;b&gt;Conexões: &lt;/b&gt; 2G GSM, 3G WCDMA, 4G LTE FDD, 4G LTE TDD&lt;br /&gt;&lt;b&gt;USB Interface: &lt;/b&gt; USB - Tipo C&lt;br /&gt;&lt;b&gt;Versão de USB: &lt;/b&gt; USB 2.0&lt;br /&gt;&lt;b&gt;Versão de Bluetooth: &lt;/b&gt; Bluetooth v5.0&lt;br /&gt;&lt;b&gt;PC Sync: &lt;/b&gt; Smart Switch (Versão para PC)&lt;br /&gt;&lt;b&gt;Conector de Fone de Ouvido: &lt;/b&gt; Conexão 3.5mm Estéreo (Padrão P2)&lt;br /&gt;&lt;b&gt;Wi-fi: &lt;/b&gt; Sim 802.11 a/b/g/n/ac 2.4+5GHz&lt;br /&gt;&lt;b&gt;Serviços de Localização: &lt;/b&gt; GPS, Glonass, Beidou, Galileo&lt;br /&gt;&lt;b&gt;Sensores: &lt;/b&gt; Acelerômetro, Sensor de Impressão Digital, Giroscópio, Geo Magnético, Sensor de Efeito Hall, Sensor de Luz RGB, Virtual Proximity Sensing&lt;br /&gt;&lt;b&gt;Peso: &lt;/b&gt; 184 gr&lt;br /&gt;&lt;b&gt;Dimensões (A x L x P): &lt;/b&gt; 15,89 x 7,36 x 0,84 cm&lt;br /&gt;&lt;br&gt;*O armazenamento real disponível pode variar conforme os softwares pré-instalados.&lt;/span&gt;

