&lt;p&gt;&lt;br /&gt;Part Number&lt;br /&gt;90AI00C1-M000W0 &lt;br /&gt;SKU ASUS AI2202-1A028BR &lt;br /&gt;EAN Code 7898573298862 &lt;br /&gt;C&amp;oacute;digo de homologa&amp;ccedil;&amp;atilde;o Anatel 11153-22-03109&lt;br /&gt;Processador Qualcomm Snapdragon 8+ GEN1 3,2 GHz, 6 MB Cache&lt;br /&gt;Mem&amp;oacute;ria RAM 6 GB&lt;br /&gt;Armazenamento 128 GB UFS3.1&lt;br /&gt;Tela 5,92&quot; AMOLED 120Hz&lt;/p&gt;
&lt;p&gt;Resolu&amp;ccedil;&amp;atilde;o da Tela 1080 x 2400&lt;br /&gt;Garantia 12 meses&lt;br /&gt;Wi-Fi 6E (802.11ax)+Bluetooth 5.2 (Dual Band) 2x2&lt;br /&gt;Tecnologia 5G 5G NR FR1 (DL/UP): 4.3Gbps/0.9 4300 Mbps&lt;br /&gt;Bandas 5G:n77/78/79, GSM:850/900/1800/1900, HSDPA:850/900/1700/1800/1900/2100, TD-LTE:34(2000), 38(2600), 39(1900), 40(2300), 41(2500)&lt;br /&gt;Tipo do SIM Card 1 Nano SIM&lt;br /&gt;Tipo do SIM Card 2 Nano SIM&lt;br /&gt;SIM Dual SIM&lt;br /&gt;C&amp;acirc;mera Frontal 12MP AF&lt;br /&gt;C&amp;acirc;mera Principal Dupla: 50Mp com OIS +12Mp Wide&lt;br /&gt;Bluetooth 5,2&lt;br /&gt;Cart&amp;atilde;o de Mem&amp;oacute;ria N&amp;atilde;o&lt;br /&gt;Audio Jack: 3.5mm Dual Mic&lt;br /&gt;R&amp;aacute;dio N&amp;atilde;o&lt;br /&gt;Sa&amp;iacute;das 1x USB 2.0 Tytpe-C OTG com Quick charge e Power Delivery 3.0 1x 3,5mm earphones&lt;br /&gt;NFC Sim&lt;br /&gt;Sensor de Girosc&amp;oacute;pio Sim&lt;br /&gt;Sensor de Proximidade Sim&lt;br /&gt;FingerPrint Sim&lt;br /&gt;GPS (L1+L5) GLONASS GLONASS (G1) BDS (B1) GALILEO (E1+E5a) QZSS (L1+L5)&lt;br /&gt;Adaptador de Energia 30,00 W&lt;br /&gt;Bateria 1 Cells / 4300 mAh&lt;br /&gt;Sistema Operacional Android 12&lt;/p&gt;
&lt;p&gt;Conte&amp;uacute;do da Embalagem:&lt;br /&gt;Telefone&lt;br /&gt;Carregador&lt;br /&gt;Cabo de dados&lt;br /&gt;Manual do usuario&lt;br /&gt;Cart&amp;atilde;o garantia&lt;br /&gt;Pino ejetor&lt;/p&gt;
&lt;p&gt;Peso do Produto 0,169 Kg&lt;br /&gt;Dimens&amp;otilde;es 14,65 cm X 6,81 cm X 0,91 ~ 0,91 cm&lt;br /&gt;Outros Prote&amp;ccedil;&amp;atilde;o IP68&lt;/p&gt;
