&lt;b&gt;4 vezes mais campo de visão&lt;/b&gt;&lt;br/&gt;Capture o que os seus olhos veem enquadrando 4 vezes mais da cena com a câmera Ultra-Wide. Com uma lente de ângulo aberto de 118° suas fotos vão evoluir de boas para sensacionais.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Não perca nenhum momento&lt;/b&gt;&lt;br/&gt;A câmera de 16 MP com foco automático (PDAF) captura a pessoa ou objeto em um piscar de olhos para que você nunca perca aqueles momentos que só acontecem uma vez na vida&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Explore todos os detalhes&lt;/b&gt;&lt;br/&gt;Fotografe até 5x mais perto, revelando detalhes para obter uma nova perspectiva. Ao mesmo tempo, o efeito de desfoque adiciona beleza e profundidade às suas fotos. Tudo isso em uma câmera que cabe no seu bolso&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Fotos nítidas e vibrantes&lt;/b&gt;&lt;br/&gt;Capture detalhes mesmo de longe com a câmera teleobjetiva com 2x zoom óptico de alta resolução - e o melhor: sem comprometer a qualidade das suas fotos.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Home theater Longe de casa&lt;/b&gt;&lt;br/&gt;Curta um som surround nítido e realista graças ao Dolby Audio. Com a Tela Max Vision 6,4&quot; Full HD aproveite o melhor dos seus conteúdos favoritos em uma tela que proporciona visualização máxima de fotos, filmes, vídeos, jogos e muito mais.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Desempenho ultrarrápido&lt;/b&gt;&lt;br/&gt;Com o processador octa-core Qualcomm Snapdragon 665 e 4 GB de RAM, o moto G8 power oferece todo o desempenho que você procura. Não perca mais tempo esperando os apps carregarem. Navegue, assista, trabalhe e jogue num piscar de olhos&lt;br/&gt;&lt;br /&gt;&lt;b&gt;&lt;span style=&apos;font-size:18px;&apos;&gt;
