&lt;b&gt;Design Incrível&lt;/b&gt;&lt;br/&gt;Beleza além da aparência. Padrões visuais dinâmicos se unem para um acabamento fosco excepcional e uma textura confortável, à prova de impressões digitais.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Uma tela de respeito&lt;/b&gt;&lt;br/&gt;A tela grande ficou ainda maior. Curta as suas séries favoritas, veja seus vloggers favoritos e jogue como nunca na imensa tela HD+ de 6,6&apos;&apos;. A simplicidade do design Punch Hole garante mais espaço na tela para proporcionar imersão total.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Exatamente como você quer ouvir&lt;/b&gt;&lt;br/&gt;O mecanismo de som 3D da LG analisou 17 milhões de amostras de áudio para produzir sempre o som ideal. Músicas de todos os gêneros, jogos, podcasts e filmes ficam sempre com som fenomenal.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Multiplique por 4 as suas opções de foto&lt;/b&gt;&lt;br/&gt;4 maneiras de tirar fotos incríveis. A câmera Inteligente de 48 MP, a câmera macro de 2 MP, a câmera Super Grande Angular de 5 MP e a câmera de modo retrato de 2 MP se unem em um atraente conjunto quádruplo para criar os mais variados tipos de fotos.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Veja o que não podia ser visto&lt;/b&gt;&lt;br/&gt;Todos os detalhes. O dia todo. A noite toda. A Tecnologia Quad Cell apresenta a tecnologia pixel binning para tirar fotos e vídeos com pouca luz e fotos mais nítidas com luz forte. O resultado? Fotos impressionantes, sempre!&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Suas fotos perfeitas em cada detalhe&lt;/b&gt;&lt;br/&gt;Capture detalhes imperceptíveis a olho nu. Mesmo sem aumentar o zoom, tire fotos incríveis do nariz do seu gatinho, das asas de uma borboleta ou de gotas de orvalho na grama.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;O jeito fácil de encaixar tudo nas suas fotos&lt;/b&gt;&lt;br/&gt;Capture a turma toda sem deixar ninguém de fora. A Câmera Super Grande Angular estabelece um ângulo de captura maior para que caiba tudo na sua foto.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Mais profundidade. Mais beleza&lt;/b&gt;&lt;br/&gt;Faça seus amigos pensarem que você é um profissional. A câmera de modo retrato desfoca os lugares certos para criar um irresistível efeito bokeh.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Bateria de alta duração&lt;/b&gt;&lt;br/&gt;Feita para durar o dia todo. A bateria de 4.000 mAh é o suficiente para que você utilize o seu Smartphone o dia todo sem precisar recarregar.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Aprovado em testes militares&lt;/b&gt;&lt;br/&gt;Acidentes acontecem, mas, com a certificação MIL-STD-810G, seu smartphone consegue aguentar o tranco. Testes militares comprovam que ele pode suportar estilos de vida ativos e quedas eventuais.&lt;br/&gt;&lt;br /&gt;&lt;b&gt;&lt;span style=&apos;font-size:18px;&apos;&gt;
CARACTERÍSTICAS
