&lt;b&gt;Ideal para quem busca conforto, praticidade e conectividade&lt;/b&gt;&lt;br/&gt;Tela de 2.8??, conexão 3G e bateria de longa duração fazem o P38 ser a escolha perfeita pro seu próximo celular.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Conectividade na ponta dos seus dedos&lt;/b&gt;&lt;br/&gt;O seu novo Positivo P38 possui conexão com a rede 3G e compatibilidade com todas as operadoras do Brasil. Além disto, com o dual SIM desbloqueado, a escolha fica com você.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Fácil para a melhor idade&lt;/b&gt;&lt;br/&gt;Os botões físicos e um sistema operacional simplificado, facilitam o uso do aparelho por idosos.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Sua vida com mais luz&lt;/b&gt;&lt;br/&gt;Com um potente LED Flash no topo do telefone e uma tecla de atalho, a lanterna do seu Positivo P38 esta sempre a posto para qualquer emergência.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Fique longe do carregador&lt;/b&gt;&lt;br/&gt;Graças a bateria de 1.000 mAh, seu P38 garante autonomia por dias, garantindo que você poderá ficar longe de tomadas durante o dia.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Nunca mais fique sem sua rádio favorita&lt;/b&gt;&lt;br/&gt;Seu Positivo P38 tem uma antena interna para Rádio FM, funcionando sem precisar conectar o fone de ouvido.&lt;br/&gt;&lt;br /&gt;&lt;b&gt;&lt;span style=&apos;font-size:18px;&apos;&gt;
